import React, { Component } from 'react';
import './Styles/Floating.css' 
import Slider from './Slider'

class Floating extends Component {
    render() {
        return (
            <div className="Floating">
                <Slider />
            </div>
        );
    }

    componentDidMount()
    {
        var floating= document.querySelectorAll('.Floating')
        floating.style.width = this.props.w;
        floating.style.height = this.props.h;
        floating.style.marginLeft = this.props.ml;
        floating.style.marginTop = this.props.mt;
    }
}

export default Floating;
